    constructor(props) {
        super(props);
    }
    render(){
        return(
            <table className="table">
                <thead className="thead-dark">
                <tr>
                    <th scope="col">NÃ¡zev</th>
                    <th scope="col">Ingredience</th>
                    <th scope="col">Popis</th>
                </tr>
                </thead>
                <tbody>
                {
                    this.props.foods != undefined &&
                    this.props.foods.map(f => {
                        return(
                            <tr>
                                <td>{f.Name}</td>
                                <td>
                                    <div className="ingredience-list">
                                        {
                                            f.Ingrediences.map(i => <label className={styles.ingredience + " btn-sm btn-info"}>{i.Name}</label>)
                                        }
                                    </div>
                                </td>
                                <td>{f.Category}</td>
                            </tr>
                            );
                    })
                }

                </tbody>
            </table>
        );
    }
}
export default List;
